	(53,2,'Congratulations, your registration is complete.','Gratujemy pomyślnie zakończonej rejestracji.<br /> \r\nTak twój profil widzą pasujący do ciebie użytkownicy - oczywiście bez informacji, którą właśnie czytasz :)<br />\r\nAby uatrakcyjnić swój profil jeszcze bardziej, zrób co następuje:<br />\r\n1. <a href=\"%URL_FOR_PHOTOS%\" class=\"actions\">Dodaj najlepsze zdjęcia</a>, jakie posiadasz. W razie potrzeby poproś o przysługę kolegę fotografa lub zapłać za sesję u profesjonalisty-  na zdjęciach nie oszczędzaj!<br />\r\n2. Od czasu do czasu zajrzyj na stronę <a href=\"%URL_FOR_ESSAY%\" class=\"actions\">\"O mnie\"</a>, aby upewnić się, że brzmi świeżo i nie ma błędów.<br />\r\n3. Uaktualnij też <a href=\"%URL_FOR_SELF_DESCRIPTION%\" class=\"actions\">swój opis</a>.<br />\r\nJeśli twój profil ci się podoba i nie chcesz nic zmieniać, możesz w każdej chwili wrócić do <a href=\"%URL_FOR_DASHBOARD%\" class=\"actions\">swojego konto</a>. [ref.301]',NULL,'',0,1261811597,8,0,NULL,NULL),
	(54,2,'To edit your profile, go to self-description, posting/essay or photos on your dashboard.','Tak twój profil widzą pasujący do ciebie użytkownicy - oczywiście bez informacji, którą właśnie czytasz :)<br />\r\nAby uatrakcyjnić swój profil jeszcze bardziej, zrób co następuje:<br />\r\n1. <a href=\"%URL_FOR_PHOTOS%\" class=\"actions\">Dodaj najlepsze zdjęcia</a>, jakie posiadasz. W razie potrzeby poproś o przysługę kolegę fotografa lub zapłać za sesję u profesjonalisty-  na zdjęciach nie oszczędzaj!<br />\r\n2. Od czasu do czasu zajrzyj na stronę <a href=\"%URL_FOR_ESSAY%\" class=\"actions\">\"O mnie\"</a>, aby upewnić się, że brzmi świeżo i nie ma błędów.<br />\r\n3. Uaktualnij też <a href=\"%URL_FOR_SELF_DESCRIPTION%\" class=\"actions\">swój opis</a>.<br />\r\nJeśli twój profil ci się podoba i nie chcesz nic zmieniać, możesz w każdej chwili wrócić do <a href=\"%URL_FOR_DASHBOARD%\" class=\"actions\">swojego konto</a>. [ref.302]',NULL,'',0,1261811597,9,0,NULL,NULL),
