	(109,1,'IMBRA headline','IMBRA - certain background information required from US customers',NULL,'',0,1251612542,65,0,NULL,NULL),
	(110,1,'IMBRA instructions','If you are US citizen living in the USA or US citizen not living in the USA but planning to live in the USA with your future foreign spouse, US law requires you to fill out this form. This is not our idea. It is US law introduced by US government.<br />\r\n<span class=\"public_reg_notice\">(Estimated time 120 seconds)</span><br /><br />\r\nIf you are not US citizen, <a href=\"%URL_FOR_CONFIRM_IMBRA_STATUS%\" class=\"sec_link\">click here to leave this page</a>.<br /><br />\r\n<span class=\"public_reg_notice\"><strong>Required by United States International Marriage Broker Regulation Act of 2005</strong><br />\r\nDue to the new legislation effective since March 6, 2006, the International Marriage Broker Act of 2005 (so called IMBRA), we must collect the following background information from each customer interested in using our services. We also have to make an electronic search on the National Sex Offender public registry and pertinent State Sex Offender public registry. This information will be translated to Polish and presented to any Polish women (or men, if you are a woman) who tries to contact you, or wants to reply to your message, or simply receives your message. In addition to your background check information, we will present a foreign person with the information in Polish, about legal rights and resources for immigrant victims of domestic violence. According to this law, we also have to inform you, whether it applies to you or not, that after filing a petition for a K non-immigrant visa, you will be subject to a criminal background check.<br /><br />If you answer \"YES\" to any of the questions below, please provide a Detailed Statement of Explanation and Information, or alternatively any Necessary Optional Documentation. Additional documents may require a translation fee.\r\n</span>',NULL,'',0,1251612542,66,0,NULL,NULL),
	(111,1,'IMBRA instructions (edit)','Below are the answers you have provided in your IMBRA background information form. If any of them changed, you are required to update the application immediately.<br />\r\nIf you are not US citizen, <a href=\"%URL_FOR_CONFIRM_IMBRA_STATUS%\" class=\"sec_link\">click here to leave this page</a>, otherwise please fill out this form.<br />\r\n<span>Change the selection or answer and click Save on the bottom of the page.</span><br /><br />\r\n<span class=\"public_reg_notice\">Due to the new legislation effective since March 6, 2006, the International Marriage Broker Act of 2005 (so called IMBRA), we must collect the following background information from each customer interested in using our services. We also have to make an electronic search on the National Sex Offender public registry and pertinent State Sex Offender public registry. This information will be translated to Polish and presented to any Polish women (or men, if you are a woman) who tries to contact you, or wants to reply to your message, or simply receives your message. In addition to your background check information, we will present a foreign person with the information in Polish, about legal rights and resources for immigrant victims of domestic violence. According to this law, we also have to inform you, whether it applies to you or not, that after filing a petition for a K non-immigrant visa, you will be subject to a criminal background check.<br /><br />If you answer \"YES\" to any of the questions below, please provide a Detailed Statement of Explanation and Information, or alternatively any Necessary Optional Documentation. Additional documents may require a translation fee.\r\n</span>',NULL,'',0,1251612542,67,0,NULL,NULL),
	(112,1,'IMBRA notice','<p><span class=\"public_reg_notice\">I certify and attest, under penalty of perjury and false swearing, that I am 18 years of age or older, of sound mind, and that my above BACKGROUND INFORMATION as well as all accompanying documents I have provided, if any, is true, correct and complete, and that should any such information change at any time, I will provide such changes or updates to PolishRomance.com. FURTHERMORE, I authorize PolishRomance.com to release and provide this information and any accompanying documentation along with any subsequent changes or updates, in any format, to all foreign ladies (or gentlemen, if you are a woman), interested in contacting me or replying to my message or receiving my message. I hereby waive any privacy rights from release of this information and I release and hold harmless, and forever discharge, PolishRomance.com, its officers, directors, shareholders, employees and agents, from any and all liabilities arising from the release of this information, the accompanying documents, and any changes or updates, and any use thereof.</span></p>\r\n<p><span class=\"public_reg_notice\">Electronic Signature: simply type your full name below preceded and followed by forward slash sign (/) - this will be considered as your signature. Your address will NOT be shown, given, sold, or otherwise made available to any user or third party, unless if required by law. </span></p><br />\r\n<br />',NULL,'',0,1251612542,68,0,NULL,NULL),
