	(139,2,'Homepage introduction','<br />\r\n<br />\r\n<h2>Kim Jest Milioner?</h2>\r\n<p>Zaradny i inteligenty, masz ponad 1 mln majątku lub co najmniej 100 tys. dochodu rocznie. Stawiasz sobie cele i je realizujesz. Jeśli chodzi o kobiety, nie masz czasu na gierki i podchody. Szukasz atrakcyjnej dziewczyny, przy której poczujesz, że żyjesz. Kobiety, której zapewnisz komfort i wygodę. Szukasz swojej <a href=\"http://www.szukammilionera.com/search/public/filter/filter/filters%5Blooking_for%5D/M_F.html\">księżniczki</a>...</p>',NULL,'',0,1276612160,2,0,NULL,NULL),
	(140,2,'Homepage title','Szukam Milionera - Piękne Kobiety i Zamożni Mężczyźni',NULL,'',0,1276612160,3,0,NULL,NULL),
	(141,2,'Homepage keywords','szukam mezczyzny, szukam kobiety, szukam meza, szukam zony, szukam dziewczyny, szukam chlopaka, randka, narzeczony, seks, anonse, narzeczona, swatka, serwis zapoznawczy, malzenstwo, flirt, romans, szukam obcokrajowca',NULL,'',0,1276612160,4,0,NULL,NULL),
	(142,2,'Homepage description','Szukam Milionera ™ to miejsce dla bogatych  mężczyzn i pięknych kobiet, którzy pragną poznać się w celu towarzyskim lub matrymonialnym. Serwis jest bezpłatny dla Pan, płatny dla Panów. Na co czekasz, odmień swe życie! Nie masz nic do stracenia!',NULL,'',0,1276612160,5,0,NULL,NULL),
