	(171,2,'Essay content','Najlepiej odpowiedz na poniższe pytania:<br /><br />\r\n<ul>\r\n<li>Czym się zajmujesz?</li>\r\n<li>Jakiego związku szukasz (małżeństwo, romans, stały układ ze wsparciem finansowym, itp.)\r\n<li>Co możesz wnieść do związku (np. powiew młodości, entuzjazm, radosny seks lub, z drugiej strony, doświadczenie, kontakty, rozwiązanie problemów finansowych)</li>\r\n<li>Czego oczekujesz od poznanej tu osoby?</li>\r\n<li>Kogo chcesz tu poznać? Kto powinien się z tobą kontaktować?</li>\r\n<li>... <a href=\"/page/writing_tips.html\" class=\"bread\">(więcej na temat jak dobrze opisać swój profil - dla bardzo ambitnych:))</a></li>\r\n</ul>\r\n',NULL,'',0,1268470056,47,0,NULL,NULL),
