	(239,1,'Allowed characters for username are [a-zA-Z][0-9] and underscore, min 4 chars max 20.','For username use between 4 and 20 of the following characters: [a-z, A-Z], [0-9] and underscore \"_\". ',NULL,'',0,1268206230,136,0,NULL,NULL),
	(240,2,'Allowed characters for username are [a-zA-Z][0-9] and underscore, min 4 chars max 20.','Dozwolone znaki w nazwie użytkownika to małe i duże litery od a do z, cyfry od 0 do 9, i podkreślnik \"_\"-  nie mniej niż 4 znaki, nie więcej niż 20.',NULL,'',0,1268206217,136,0,NULL,NULL),
