	(245,2,'Email verification','Gratulacje, zmieniłeś adres e-mailowy!',NULL,'',0,1269122118,93,0,NULL,NULL),
	(246,2,'Your email address (%EMAIL%) has been verified. You may now use it to log in','Pomyślnie zakończyłeś zmianę adresu e-mailowego. Odtąd używaj %EMAIL% do logowania się. Możesz teraz wrócić na <a href=\"%URL_FOR_SIGNIN%\" class=\"sec_link\">swoje konta</a>. <span class=\"extra_info\">[SM603]</a>',NULL,'',0,1269122118,94,0,NULL,NULL),
	(247,2,'Your new password has been confirmed','Gratulacje, zmieniłeś hasło!',NULL,'',0,1269122118,95,0,NULL,NULL),
	(248,2,'You successfully changed your password. Now you can use your new password to log in.','Pomyślnie zakończyłeś zmianę hasła. Możesz teraz wrócić na <a href=\"%URL_FOR_SIGNIN%\" class=\"sec_link\">swoje konto</a>. <span class=\"extra_info\">[SM604]</a>',NULL,'',0,1269122118,96,0,NULL,NULL),
	(249,2,'Status canceled headline','Konto zamknięte przez administratora',NULL,'',0,1269122118,97,0,NULL,NULL),
	(250,2,'Status canceled body','Twoje konto zostało zamknięte przez administratora serwisu z powodu naruszenia    <a href=\"{USER_AGREEMENT_URL}\" class=\"sec_link\">warunków użytkowania serwisu</a>, np. spamming, scamming, podejrzane zachowanie, użycie kradzionej karty kredytowej, dokuczanie innym użytkownikom, niedozwolona reklama lub kryptoreklama, lub inne nadużycia lub naruszenia regulaminu.\r\n<p>Jeśli posiadałeś konto Premium, nie będziesz już obciążany żadną opłatą.</p>\r\n<p>Jeśli uważasz, ze twoje konto zostało zamknięte przez pomyłkę, <a href=\"{CONTACT_US_URL}\" class=\"sec_link\">skontaktuj się z nami</a>. <span class=\"extra_info\">[SM606]</a></p>',NULL,'',0,1269122118,98,0,NULL,NULL),
	(251,2,'Status denied headline','Twoja rejestracja nie została zaakceptowana',NULL,'',0,1269122118,99,0,NULL,NULL),
	(252,2,'You registration has been denied.','Twoja aplikacja została odrzucona. Zgodnie z naszymi <a href=\"{USER_AGREEMENT_URL}\" class=\"sec_link\">Warunkami Użytkowania Serwisu</a>, mamy prawo odmówić członkostwa bez podania przyczyny.<br />\r\nW internecie są tysiące serwisów zapoznawczych-  na pewno znajdziesz taki, który lepiej zaspokoi twoje potrzeby. <span class=\"extra_info\">[SM607]</a>',NULL,'',0,1269122118,100,0,NULL,NULL),
	(253,2,'Status flagged headline','Twoje konto jest zawieszone (oflagowania)',NULL,'',0,1269122118,101,0,NULL,NULL),
	(254,2,'Status flagged body','Twoje konto zostało zgłoszone przez innych użytkowników (oflagowane) i jest sprawdzane przez administratora serwisu. Spróbuj zalogować się jutro w celu sprawdzenia swojego statusu. <span class=\"extra_info\">[SM608]</a>',NULL,'',0,1269122118,102,0,NULL,NULL),
	(255,2,'Status pending headline','Twoj profil zostanie sprawdzony.',NULL,'',0,1269122118,103,0,NULL,NULL),
	(256,2,'Status pending body','Gratulacje! Pomyślnie zakończyłeś rejestrację. Twój profil zostanie przejrzany i odezwiemy się najpóźniej w ciągu kilku godzin. <span class=\"extra_info\">[SM609]</a>',NULL,'',0,1269122119,104,0,NULL,NULL),
	(257,2,'Status suspended headline','Konto zawieszone przez administratora serwisu',NULL,'',0,1269122119,105,0,NULL,NULL),
	(258,2,'Status suspended body','Twoje konto zostało zamknięte przez administratora serwisu z powodu naruszenia    <a href=\"{USER_AGREEMENT_URL}\" class=\"sec_link\">warunków użytkowania serwisu</a>, np. spamming, scamming, podejrzane zachowanie, użycie kradzionej karty kredytowej, dokuczanie innym użytkownikom, niedozwolona reklama lub kryptoreklama, lub inne nadużycia lub naruszenia regulaminu.<br /> Sprawdź za dzień lub dwa, czy dalej możesz używać nasza serwis. <span class=\"extra_info\">[SM610]</a> ',NULL,'',0,1269122119,106,0,NULL,NULL),
	(259,2,'Tell a Friend Headline','Wiadomość wysłana. Dziękujemy!',NULL,'',0,1269122119,107,0,NULL,NULL),
	(260,2,'Tell a Friend body','Wiadomość została wysłana. Dziękujemy, że polecasz nas swoim znajomym!\r\n<p>\r\nJeśli tego jeszcze nie zrobiłeś, <a href=\"%URL_FOR_JOIN_NOW%\" class=\"sec_link\">przyłącz się do nas</a>, a jeśli już z nami jesteś, <a href=\"%URL_FOR_DASHBOARD%\" class=\"sec_link\">zaloguj się</a>, aby przejść do swojego konta. <span class=\"extra_info\">[SM611]</a></p>',NULL,'',0,1269122119,108,0,NULL,NULL),
	(261,2,'Email undo headline','unieważniłeś zmianę adresu e-mailowego.',NULL,'',0,1269122119,109,0,NULL,NULL),
	(262,2,'Your have undo your email change. Your email address is back to: %EMAIL%','Pomyślnie unieważniłeś ostatnią zmianę adresu e-mailowego. Twój adres e-mailowy to ponownie: %EMAIL%. <a href=\"%URL_FOR_REGISTRATION%\" class=\"sec_link\">Zaloguj się</a> i od razu  zmień hasło. Niech twoje nowe hasło będzie kombinacją DUŻYCH i małych liter, i niech nie będzie to data twoich urodzin, imiona bliskich osób, itp. Po zmianie hasła, zmień również adres emailowy, który używasz z naszym kontem. <span class=\"extra_info\">[SM612]</a>',NULL,'',0,1269122119,110,0,NULL,NULL),
	(263,2,'Verify your email headline','Potwierdź swój adres e-mailowy',NULL,'',0,1269122119,111,0,NULL,NULL),
	(264,2,'For your own security, please go to your email box and verify your email by clicking on the link we have just sent you.','<p>UWAGA: TWOJE KONTO NIE JEST JESZCZE AKTYWNE.</p>\r\n<p>Zajrzyj do swojej skrzynki e-mailowej i przeczytaj wiadomość, którą ci właśnie wysłaliśmy. Jeśli nie znajdziesz jej w otrzymanych wiadomościach, poszukaj w folderze Spam lub Śmieci, po czym oznacz jako Nie Spam.</p>\r\nWeryfikacja adresu e-mailowego jest po to, aby inne osoby nie mogły rejestrować się przy użyciu twojego adresu e-mailowego. <span class=\"extra_info\">[SM613]</a>',NULL,'',0,1269122119,112,0,NULL,NULL),
	(265,2,'Welcome headline','E-mail zweryfikowany! Kontynuuj rejestrację.',NULL,'',0,1269122119,113,0,NULL,NULL),
	(266,2,'Welcome body','Gratulacje! Właśnie zweryfikowałeś swój e-mail i aktywowałeś konto. Możesz teraz <a href=\"{REGISTRATION_URL}\" class=\"sec_link\">dokończyć rejestrację</a>.<br /><span class=\"extra_info\">[wiadomość:614]</a>',NULL,'',0,1269122119,114,0,NULL,NULL),
