	(7186,1,'Assistant request title','Online Assistant',NULL,'',0,1276786702,138,0,NULL,NULL),
	(7187,1,'Assistant request headline','Problem? Ask for help. We will respond within 24 hours. If you need immediate assistance, check <a href=\"%URL_FOR_HELP%\" class=\"sec_link\">Help</a>.',NULL,'',0,1276786702,139,0,NULL,NULL),
	(7188,1,'Assistant request content','Most likely somebody already had the same problem. So before you write, please review these questions and answer:<br />\r\n<a class=\"sec_link\" href=\"%URL_FOR_HELP%#1\">I forgot my password</a><br />\r\n<a class=\"sec_link\" href=\"%URL_FOR_HELP%#2\">I cannot contact other members.</a><br />\r\n<a class=\"sec_link\" href=\"%URL_FOR_HELP%#3\">What if I have AOL account?</a><br />\r\n<a class=\"sec_link\" href=\"%URL_FOR_HELP%#4\">How do I sing up?</a><br />\r\n<a class=\"sec_link\" href=\"%URL_FOR_HELP%#5\">How do I unsubscribe?</a><br />\r\n<a class=\"sec_link\" href=\"%URL_FOR_HELP%#6\">Can I delete my account?</a><br />\r\n<a class=\"sec_link\" href=\"%URL_FOR_HELP%\">... more questions and answers</a><br />\r\n<div id=\"assistant_profile\">\r\n        %ASSISTANT_IMAGE%\r\n        <p>Still can\'t find the answer? Please write to us. I\'ll do my best to respond within 24 hours.<br /><br />\r\n        Agnieszka, Online Assistant</p>\r\n</div>',NULL,'',0,1276786702,140,0,NULL,NULL),
	(7189,1,'Assistant response title','Message received',NULL,'',0,1276786702,141,0,NULL,NULL),
	(7190,1,'Assistant response content','<br />\r\nThank you for your message. We will try to respond within 24 hours.<br />\r\n<br />\r\nAgnieszka<br />\r\n<br />\r\n<a href=\"%URL_FOR_DASHBOARD%\" class=\"sec_link\">Back to your account</a>',NULL,'',0,1276786702,142,0,NULL,NULL),
	(7191,2,'Profiles sorted by most recent. Change filter settings if needed.','Oto świeżo zarejestrowane osoby. Użyj filtr poniżej (jeśli trzeba) i kliknij Wyszukaj.\r\n',NULL,'',0,1276673392,12,1234212398,NULL,NULL),
	(7192,2,'Assistant request title','Wirtualny Asystent ',NULL,'',0,1241460424,138,1234303360,NULL,NULL),
	(7193,2,'Assistant request headline','Masz problem? Napisz do nas. Odpowiemy w ciągu 24 godzin. Jeśli potrzebujesz natychmiastowej odpowiedzi, zajrzyj do <a href=\"%URL_FOR_HELP%\" class=\"sec_link\">Pomocy</a>. ',NULL,'',0,1241460424,139,1234303360,NULL,NULL),
	(7194,2,'Assistant request content','Prawdopodobnie ktoś inny miał już ten sam problem. Zanim więc do nas napiszesz, przeczytaj odpowiedzi do najczęstszych pytań:<br />\r\n<a class=\"sec_link\" href=\"%URL_FOR_HELP%#1\">Zapomniałem hasło</a><br />\r\n<a class=\"sec_link\" href=\"%URL_FOR_HELP%#2\">Nie mogę wysyłać wiadomości.</a><br />\r\n<a class=\"sec_link\" href=\"%URL_FOR_HELP%#3\">Problemy z kontem \"pl\"</a><br />\r\n<a class=\"sec_link\" href=\"%URL_FOR_HELP%#4\">Jak się zapisać?</a><br />\r\n<a class=\"sec_link\" href=\"%URL_FOR_HELP%#5\">Jak zakończyć subskrypcję konta Premium</a><br />\r\n<a class=\"sec_link\" href=\"%URL_FOR_HELP%#6\">Jak zamknąć konto?</a><br />\r\n<a class=\"sec_link\" href=\"%URL_FOR_HELP%\">... wszystkie pytania i odpowiedzi</a><br />\r\n<div id=\"assistant_profile\">\r\n        %ASSISTANT_IMAGE%\r\n        <p>Nie możesz znaleźć odpowiedzi? Napisz do nas. Zazwyczaj odpowiadamy w ciągu 24 godzin!<br /><br />\r\n        Mariola, Online Assistant</p></div>',NULL,'',0,1241460424,140,1234303360,NULL,NULL),
	(7195,2,'Assistant response title','Wiadomość otrzymana',NULL,'',0,1241460424,141,1234303360,NULL,NULL),
	(7196,2,'Assistant response content','<br />\r\nDziękujemy za wiadomość. Postaramy się odpowiedzieć w ciągu 24 godzin.<br /><br />\r\nMariola<br /br><br />\r\n<a href=\"%URL_FOR_DASHBOARD%\" class=\"sec_link\">Wróć do swojego konta</a><br />',NULL,'',0,1241460424,142,1234303360,NULL,NULL),
	(7197,2,'Profiles sorted by match percentage.','Ty i poniższe profile, najlepiej spełniacie swoje kryteria wyszukiwania. Aby zobaczyć inne rezultaty, zmień swoje <a href=\"%URL_FOR_SEARCH_CRITERIA%\" class=\"actions\">kryteria wyszukiwania</a>.',NULL,'',0,1276673535,15,1235492737,NULL,NULL),
