	(7850,1,'The payment is for review and handling of you application and includes checking your record in national and state sex offenders registers and translation of your application into Polish. According to our <a href=\"/translate.php/en/page/user_agreement.html\" class=\"sec_link\">Terms of Use</a>, even if we reject your application for whatever reason, your payment will not be refunded.<br /><br />\r\n\r\n	    Please pay and continue only if agree to these and other terms expressed in our <a href=\"/translate.php/en/page/user_agreement.html\" class=\"sec_link\">Terms of Use</a>.<br />','',NULL,'',0,2009,NULL,0,'Payment,IMBRA','/IMBRA/payment.html'),
	(7851,2,'The payment is for review and handling of you application and includes checking your record in national and state sex offenders registers and translation of your application into Polish. According to our <a href=\"/translate.php/en/page/user_agreement.html\" class=\"sec_link\">Terms of Use</a>, even if we reject your application for whatever reason, your payment will not be refunded.<br /><br />\r\n\r\n	    Please pay and continue only if agree to these and other terms expressed in our <a href=\"/translate.php/en/page/user_agreement.html\" class=\"sec_link\">Terms of Use</a>.<br />','<p>Niniejsza zapłata dotyczy przeglądu i weryfikacji podanych przez ciebie informacji z przeszłości. Wymaganie tych informacji od amerykańskich klientów narzuca nam obowiązujące w USA prawo zwane International Marriage Broker Regulation Act of 2005 (w skrócie: IMBRA). Nasza weryfikacja polegać będzie na porównaniu podanych przez ciebie informacji z twoimi informacjami zawartymi w rejestrach stanowych, federalnych lub komercyjnych bazach danych, a następnie na przetłumaczeniu podanych przez ciebie informacji na język polski.</p>\r\n<p>W przypadku jakichkolwiek rozbieżności pomiędzy podanymi przez ciebie informacjami a tym uzyskanymi z naszych źródeł-  lub jeśli nie będzie rozbieżności, ale dojdziemy do wniosku, że mógłbyś stanowić zagrożenie dla naszych użytkowników-  lub, jeśli uznamy, że mógłbyś nie spełniać naszych <a href=\"%URL_FOR_TERMS%\" class=\"sec_link\">Warunków Świadczenia Usług</a>, twoja rejestracja zostanie odrzucona, a dokonana przez ciebie wpłata nie zostanie zwrócona. Jeśli z tym się nie zgadasz, nie rejestruj się!</p>\r\n',NULL,'',1,2009,NULL,0,'Payment,IMBRA',''),
	(7852,3,'The payment is for review and handling of you application and includes checking your record in national and state sex offenders registers and translation of your application into Polish. According to our <a href=\"/translate.php/en/page/user_agreement.html\" class=\"sec_link\">Terms of Use</a>, even if we reject your application for whatever reason, your payment will not be refunded.<br /><br />\r\n\r\n	    Please pay and continue only if agree to these and other terms expressed in our <a href=\"/translate.php/en/page/user_agreement.html\" class=\"sec_link\">Terms of Use</a>.<br />','',NULL,'',0,2009,NULL,0,'Payment,IMBRA',NULL),
