	(8006,1,'IMBRA Payment Content','The payment is for review and handling of you application and includes checking your record in national and state sex offenders registers and translation of your application into Polish. According to our <a href=\"%URL_FOR_TERMS%\" class=\"sec_link\">Terms of Use</a>, even if we reject your application for whatever reason, your payment will not be refunded.<br /><br />\r\n	    Please pay and continue only if agree to these and other terms expressed in our <a href=\"%URL_FOR_TERMS%\" class=\"sec_link\">Terms of Use</a>.<br /><br />\r\nBy clicking Pay Now button, I agree to all the terms and to pay a non-refundable fee of £%AMOUNT%.<br /><br /><br />',NULL,'',0,2009,NULL,0,'Payment,IMBRA','/IMBRA/payment.html'),
