	(9508,1,'Post your story confirmation body','Our team will review your story and hopefully it will be available online soon.<br />\r\nPlease note that according to our <a href=\"%URL_FOR_TERMS%\" class=\"sec_link\">Terms of Use</a> and <a href=\"%URL_FOR_PRIVACY_POLICY%\" class=\"sec_link\">Privacy Policy</a>, we reserve the right to cut, edit or otherwise change your story without any explanation. We may also take your story off our site at any time or not publish it at all. We also do not respond to any queries related to the stories, except for request to take the story off the site. In order to do so however, you must write to us from the same email address as you entered while submitting the story.',NULL,'',1,0,NULL,0,'PostYourStory','en/memberStories/postYourStory.html'),
	(9509,2,'Post your story confirmation body','Przeczytamy twój artykuł i jeśli nam się spodoba, udostępnimy go dla wszystkich.<br /><br />\r\nZgodnie z naszą <a href=\"%URL_FOR_TERMS%\" class=\"sec_link\">Umową Serwisową</a> i <a href=\"%URL_FOR_PRIVACY_POLICY%\" class=\"sec_link\">Polityką Prywatności</a>, rezerwujemy sobie prawo, w każdej w chwili, skrócić, edytować lub w inny sposób zmienić, lub usunąć z naszego serwisu, lub nie opublikować otrzymanego artykułu w ogóle - bez podania przyczyny i bez uprzedzenia o tym autora. Nie odpowiadamy też na pytania dotyczące artykułów, z wyjątkiem prośby autora o usuniecie jego artykułu-  w takim wypadku autor musi napisać do nas z tego samego adresu e-mailowego, z którego przysłał nam artykuł.',NULL,'',1,0,NULL,0,'PostYourStory','/memberStories/postYourStoryConfirmation.html'),
