	(10067,1,'Thank you gift body','Thank you for the gift. It is always a pleasure to see members buying gifts.<br />\r\n<br />\r\nPlease note that while the receiver of your gift will surely be grateful for it, she or he is not required to reciprocate in any way and may still block or flag your profile, whenever she deems appropriate.<br /><br />',NULL,'',0,0,NULL,0,'Payment',''),
	(10068,2,'Thank you gift body','Dziękujemy za prezent. To bardzo milo, gdy użytkownicy kupują sobie prezenty.<br />\r\n<br />\r\nPamiętaj jednak, że choć osoba, której kupiłeś prezent będzie z pewnością wdzięczna, nie musi traktować cię w żaden szczególny sposób i w dalszym ciągu może zablokować cię lub zgłosić do administratora, gdy tylko uzna to za stosowne.<br /><br />',NULL,'',1,0,NULL,0,'Payment',''),
