	(10964,1,'Manage subscription - auto-renewal','<span class=\"public_reg_notice\"><h1>Your Subscription & Auto Renewal Status</h1></span>\r\nAccount type: <span class=\"public_reg_notice\">Premium</span>. To see what features are available to you, <a href=\"/en/subscription.html\" class=\"sec_link\">click here</a>.<br />\r\nCurrent subscription term: <span class=\"public_reg_notice\"> {amount_1st_period} for {1st period}, then {amount for 2nd period} for {2nd period}, after that {amount after that} every {3rd and following period}</span>.<br />\r\nNext payment amount: <span class=\"public_reg_notice\">%NEXT_PAYMENT_AMOUNT%</span><br />\r\nNext payment date: <span class=\"public_reg_notice\">%NEXT_PAYMENT_DATE%</span><br />\r\nSubscription ends: <span class=\"public_reg_notice\">when you Unsubscribe*</span><br /><br />\r\nImportant Safety Note: If you paid with PayPal, please make sure that you address and credit card (or bank) information with PayPal is up-to-date. This way there will be no discontinuity in your payments and you will not lose any discount. Please remember however, that  PayPal never sends emails with request to update user details. Any email received from \"PayPal\" that asks for any of your information or its update, or simply asks you to log in by clicking on a link, is fraudulent ( so called phishing). Please report it to PayPal and delete. Then log in to PayPal (type \"PayPal.com\", don\'t use any link), and check your details, or communicate with PayPal\'s support. If your browser asks you \"Remember Password?\" click Never or No and after the session, clear browser\'s all private data and reset the browser.<br />\r\nNeither send any credit card, bank or other personal information to us. We do not need it and we never ask for it. If you think you received such request from us, it must be phishing/ fraudulent - do not respond, send it to us and then delete. <br />\r\nFinally, never send any money to other PolishDate member. Any money request on a dating site is always fraudulent. Report it to us and block the sender. <br />\r\n<br />\r\n*If you unsubscribe now, you will still use Premium account until the end of the current subscription period - that is until <span class=\"public_reg_notice\">%EOT_DATE%</span>. On that day the system will switch your account to Standard and Premium account features will not be available to you.<br />\r\nTo unsubscribe, click UNSUBSCRIBE button below.<br />If you changed your mind or want to unsubscribe later, you may go to <a href=\"%URL_FOR_DASHBOARD%\" class=\"sec_link_small\">your account</a>.\r\n<br /><br /><br />',NULL,'',0,0,NULL,0,'Subscription Management',''),
	(10965,2,'Manage subscription - auto-renewal','<span class=\"public_reg_notice\"><h1>Twój status i subskrypcja</h1></span>\r\nRodzaj konta: <span class=\"public_reg_notice\">Premium</span>. Aby zobaczyć jakie narzędzia są dostępne dla konta Premium, <a href=\"/subscription.html\" class=\"sec_link\">kliknij tu</a>.<br />\r\nAktualne warunki subskrypcji: <span class=\"public_reg_notice\">{amount 1st period} za {1st period}, potem {amount for 2nd period} for {2nd period}, następnie {amount after that} za każdy {3rd and following period}</span>.<br />\r\nKwota najbliższej płatności: <span class=\"public_reg_notice\">%NEXT_PAYMENT_AMOUNT%</span><br />\r\nData najbliższej płatności: <span class=\"public_reg_notice\">%NEXT_PAYMENT_DATE%</span><br />\r\nKoniec subskrypcji: <span class=\"public_reg_notice\">kiedy zakończysz subskrypcję*</span><br />\r\n<br />\r\nUwaga: Jeśli zapłaty dokonałeś przy pomocy konta PayPal, upewnij się, że twój adres i nr karty kredytowej lub nr konta bankowego, które podałeś do PayPal, są ciągle aktualne. Dzięki temu twoje comiesięczne obciążenia przebiegać będą bez zakłóceń, a co za tym idzie, nie stracisz ciągłości i wynikających stąd zniżek. Pamiętaj jednak, że:<br />\r\n1. PayPal nigdy nie wysyła e-maili z prośbą o uaktualnienie twoich danych. Jeśli taki e-mail otrzymasz, jest to oszustwo (tzw. phishing). Dla bezpieczeństwa, nigdy nie odpisuj an e-maile z PayPal ani nie klikaj na żadne łącza, za to bezpiecznie zaloguj się na swoje konto w PayPal i dopiero wtedy kontaktuj się z nimi. Aby bezpiecznie zalogować się na konto PayPal, zawsze ręcznie wpisuj adres Paypal.pl lub Paypal.com - nie klikaj za żadne podesłane ci łącza. Nie każ też swojej przeglądarce zapamiętać hasła, a po zakończonej sesji wyczyść i zamknij swoja przeglądarkę.<br />\r\n2. W żadnym wypadku nie przesyłaj nr swojej karty kredytowej lub konta bankowego do nas. Dane te są nam niepotrzebne i nigdy o nie nie prosimy! Jeśli myślisz, że dostałeś od nas  e-maila z prośbą o nr karty kredytowej lub nr konta bankowego, nie odpisuj - to jest oszustwo. Prześlij nam tego e-maila, po czym go wykasuj!<br />\r\n3. Nigdy nie wysyłaj pieniędzy żadnemu użytkownikowi LoveStreet.pl - każda prośba o pieniądze jest oszustwem. Zgłoś ja do nas a użytkownika zablokuj. <br />\r\n<br />\r\n*Jeśli teraz zakończysz subskrypcję, będziesz w dalszym ciągu używał konta Premium aż do końca aktualnego okresu, tj. do <span class=\"public_reg_notice\">%EOT_DATE%</span>. Tego dnia nasz system przełączy cie na konto Standard i nie będziesz miał już dostępu do narzędzi konto Premium.<br />\r\nAby zakończyć subskrypcję, kliknij przycisk ZAKOŃCZ SUBSKRYPCJĘ.<br />Jeśli zmieniłeś zdanie lub chcesz zakończyć subskrypcje w innym terminie, wróć <a href=\"%URL_FOR_DASHBOARD%\" class=\"sec_link_small\">do swojego konta</a>.\r\n<br /><br /><br />',NULL,'',1,0,NULL,0,'Subscription Management','/subscription/manage'),
