	(10977,1,'Manage subscription - gift membership','Current Subscription Term: <span class=\"public_reg_notice\">A GIFT FROM {user-name who bought the gift}</span><br />\r\n<br />\r\nSubscription Ends: <span class=\"public_reg_notice\">{end of subscription date}</span><br />\r\n<br />\r\nBefore your subscription ends, we will send you a reminder about your option to continue with Premium account.<br/>\r\n<br />\r\nPlease note that although it is customary to thank for the gift, you have no obligation to treat the giver in any special way, \r\nand you should still report to us any misbehavior or non-compliance with our Terms of Use.<br />\r\n<br /><a href=\"%URL_FOR_DASHBOARD%\" class=\"sec_link\">Back to My Account</a>',NULL,'',0,0,NULL,0,'Subscription Management',''),
	(10978,2,'Manage subscription - gift membership','Warunki subskrypcji: <span class=\"public_reg_notice\">A GIFT FROM {user-name who bought the gift}</span><br />\r\n<br />\r\nData zakończenia subskrypcji: <span class=\"public_reg_notice\">{end of subscription date}</span><br />\r\n<br />\r\nPrzed wygaśnięciem subskrypcji otrzymasz wiadomość z przypomnieniem o możliwości przedłużenia subskrypcji konta Premium.<br/>\r\n<br />\r\nPamiętaj, ze choć trzeba być wdzięcznym za prezent, nie masz obowiązku traktować darczyńcę w szczególny sposób i dalszym ciągu musisz nam zgłaszać niewłaściwe zachowanie i wszystkie inne przypadki łamania naszych Warunków Użytkowania.<br />\r\n<br /><a href=\"%URL_FOR_DASHBOARD%\" class=\"sec_link\">Wróć do swojego konta</a>',NULL,'',0,0,NULL,0,'Subscription Management','/subscription/manage.html'),
