	(11146,1,'Here you can delete your account - you will lose your information and you won\'t be able to recover it. <br /><span>Deleting your account cannot be reversed. You will loose all your information, including profile, photos and messages.<br />Are you sure you want to delete?</span><br /><br /><a href=\"%URL_FOR_YES_DELETE%\" class=\"sec_link\">Yes, delete my account anyway</a><br /><br/><a href=\"%URL_FOR_NO_DELETE%\" class=\"sec_link\">No, don\'t delete my account</a>','<p>Closing account is permanent. You will loose all your information, including profile, photos and messages.</p>\r\n<h3>Are you sure you want to close your account?</h3>\r\n<p>\r\n<br />\r\n<a href=\"%URL_FOR_YES_DELETE%\" class=\"sec_link\">Yes, delete my account anyway</a>\r\n</p>\r\n<br />\r\n<p>\r\n<a href=\"%URL_FOR_NO_DELETE%\" class=\"sec_link\">No, don\'t delete my account</a>\r\n</p>\r\n<br />\r\n<p>\r\nIf you only want to deactivate your account without closing it, please <a href=\"%URL_FOR_DEACTIVATE_PROFILE%\" class=\"sec_link\"> click here</a>.\r\n</p>',NULL,'',0,0,NULL,0,'Delete Account','/en/dashboard/deleteYourAccount.html'),
	(11147,2,'Here you can delete your account - you will lose your information and you won\'t be able to recover it. <br /><span>Deleting your account cannot be reversed. You will loose all your information, including profile, photos and messages.<br />Are you sure you want to delete?</span><br /><br /><a href=\"%URL_FOR_YES_DELETE%\" class=\"sec_link\">Yes, delete my account anyway</a><br /><br/><a href=\"%URL_FOR_NO_DELETE%\" class=\"sec_link\">No, don\'t delete my account</a>','<p>Zamknięcie konta jest nieodwracanalne. Stracisz bezpowrotnie wszystkie informacje zawarte w profilu, zdjęcia i wiadomości.</p>\r\n<h3>Czy na pewno chcesz zamknąć konto?</h3>\r\n<p>\r\n<br />\r\n<p>\r\n<a href=\"%URL_FOR_YES_DELETE%\" class=\"sec_link\">Tak, chcę zamknąć moje konto</a>\r\n</p>\r\n<br />\r\n<p>\r\n<a href=\"%URL_FOR_NO_DELETE%\" class=\"sec_link\">Nie, nie zamykaj mojego konta</a>\r\n</p>\r\n<br />\r\n<p>\r\nJesli chcesz jedynie dezaktywowac konto nie zamykajac go, <a href=\"%URL_FOR_DEACTIVATE_PROFILE%\" class=\"sec_link\"> kliknij tu</a>.\r\n</p>',NULL,'',0,0,NULL,0,'Delete Account','/dashboard/deleteYourAccount.html'),
