	(11419,1,'Essay Helpful Tips - edit','<strong>Writer\'s block? If so, write as if answering these questions:</strong><br /><br />\r\n<ul>\r\n<li>What are you doing with your life?</li><br />\r\n<li>What do you like doing when not working?</li><br />\r\n<li>Favorite book, movie, music or hobby?</li><br />\r\n<li>What are you really good at?</li><br />\r\n<li>Whom would you like to meet here? Contact me if...</li><br />\r\n<li>Be clear, concise, positive: don\'t mention bad experience, previous marriages or what you don\'t like in people (write what you like in people)... <a href=\"/en/page/writing_tips.html\" class=\"bread\">(more on writing a good profile)</a></li>\r\n</ul>',NULL,'',0,0,NULL,0,'Essay,Edit',''),
	(11420,2,'Essay Helpful Tips - edit','Najlepiej odpowiedz na poniższe pytania:<br /><br />\r\n<ul>\r\n<li>Czym się zajmujesz?</li>\r\n<li> Jakiego związku szukasz (małżeństwo, romans, stały układ ze wsparciem finansowym, itp.)\r\n<li>Co możesz wnieść do związku (np. powiew młodości, entuzjazm, radosny seks lub, z drugiej strony, doświadczenie, kontakty, rozwiązanie problemów finansowych)</li>\r\n<li>Czego oczekujesz od poznanej tu osoby?</li>\r\n<li>Kogo chcesz tu poznać? Kto powinien się z tobą kontaktować?</li>\r\n<li>... <a href=\"/page/writing_tips.html\" class=\"bread\">(więcej na temat jak dobrze opisać swój profil)</a></li>\r\n</ul>',NULL,'',1,0,NULL,0,'Essay,Edit',''),
