	(11627,1,'Request new activation email body','<p>You account has never been activated. Please check your email box to see if you received an email with activation link. Or just request new activation email:<p/>\r\n<a href=\"%URL_FOR_SEND_NEW_ACTIVATION_EMAIL%\" class=\"sec_link\">Request New Activation Email</a>\r\n<p>If you can\'t find the email again, check junk mail or spam folder.\r\n</p>\r\n<a href=\"%URL_FOR_SIGNIN%\" class=\"sec_link\">Back to sign in</a>',NULL,'',0,0,NULL,0,'Sign In (Request New Activ. Email)','/en/registration/requestNewActivationEmail.html'),
	(11628,2,'Request new activation email body','<p>Założyłeś u nas konto ale nigdy go nie aktywowałeś! Zrób co następuje:</p>\r\n<p>1. Idź do skrzynki e-mailowej i wyślij wiadomość z treścią \"aktywacja\" do hello@szukammilionera.pl</p>\r\n<p>2. Dodaj hello@szukammilionera.pl do kontaktów w swojej skrzynce e-mailowej</p>\r\n<p>3. Następnie wróć tu i kliknij na poniższe łącze, aby raz jeszcze otrzymać od nas e-mail z kodem aktywacyjnym. Jeśli nie dojdzie w ciągu 5 minut, sprawdź folder Spam (Śmiecie) i jeśli tam go znajdziesz, oznacz jako \"Nie Spam\".</p> \r\n<a href=\"%URL_FOR_SEND_NEW_ACTIVATION_EMAIL%\" class=\"sec_link\">Zażądaj nowy e-mail aktywacyjny</a>\r\n<p>\r\nJeśli problem jest już rozwiązany, <a href=\"%URL_FOR_SIGNIN%\" class=\"sec_link\">wróć do logowania</a>.</p>',NULL,'',1,0,NULL,0,'Sign In (Request New Activ. Email)','/pl/registration/requestNewActivationEmail.html'),
