	(11666,1,'Oops. You have abandoned the payment process.','<p>Oops. You have abandoned the payment process. No problem.</p>\r\n<p>\r\nGo back and <a class=\"sec_link\" href=\"%URL_FOR_PAYMENT%\">pay</a> or return to your <a class=\"sec_link\" href=\"%URL_FOR_DASHBOARD%\">main page</a> and make the payment later. Until you make the payment, you will use <a class=\"sec_link\" href=\"%URL_FOR_SUBSCRIPTION%\">Standard</a> account.</p>',NULL,'',0,0,NULL,0,'Payment, Cancel',''),
	(11667,2,'Oops. You have abandoned the payment process.','<p>Ups. Zrezygnowałeś z dokonania zapłaty. Nie szkodzi.</p>\r\n<p>\r\n<a class=\"sec_link\" href=\"%URL_FOR_PAYMENT%\">Dokończ zapłatę</a> lub wróć na <a class=\"sec_link\" href=\"%URL_FOR_DASHBOARD%\">stronę główną</a> i dokonaj zapłaty w przyszłości. Do momentu dokonania zapłaty, będziesz używać konta <a class=\"sec_link\" href=\"%URL_FOR_SUBSCRIPTION%\">Standard</a>.</p>',NULL,'',0,0,NULL,0,'Payment, Cancel',''),
