	(12746,1,'IMPORTANT! Your email address change is not complete!IMPORTANT! Your password change is complete!','IMPORTANT! Your email address change is NOT complete! Go to the inbox of your new email address, read the message we just sent you and finish the email change process. Until you do so, use your current email address to log in. <br />\r\n<br />\r\nIMPORTANT! Your password change is NOT complete. You must go to your email inbox (with Gmail or Hotmail, or Yahoo, etc.) and open the message we just sent you. Until you do so, use your current password to log in.<br />\r\n[Message:12747]',NULL,'',0,0,NULL,0,'Registration Edit',''),
	(12747,2,'IMPORTANT! Your email address change is not complete!IMPORTANT! Your password change is complete!','UWAGA! Jeszcze nie zmieniłeś adresu e-mailowego. Przejdź do swojej skrzynki e-mailowej (tej od nowego adresu) i przeczytaj wiadomość, którą ci właśnie wysłaliśmy. Dopóki tego nie zrobisz, do zalogowanie używaj starego adresu e-mailowego.<br />\r\n<br />\r\nUWAGA! Jeszcze nie zmieniłeś hasła. Idź do swojej skrzynki e-mailowej (Gmail, Yahoo, Onet, itp.) i przeczytaj wiadomość, który ci właśnie wysłaliśmy. Dopóki tego nie zrobisz, do zalogowanie używaj dotychczasowego hasła.<br />\r\n[Wiadomość:12747]',NULL,'',0,0,NULL,0,'Registration Edit',''),
