	(13415,1,'Area Info Headline','<p><a href=\"javascript:window.history.go(-1)\">[ << Back to profile ]</a></p>\r\n<h3>Taking a trip to %GEO_TREE_STRING%?</h3>\r\n<p>If you\'re planning a trip to %GEO_TREE_STRING%, please make the following arrangements:<br />\r\n1.<strong>Hotel Reservation</strong>. Make a reservation ( book ) a hotel, hostel or private apartment, buy a group tour or tours.<br />\r\n2. <strong>Travel Guide</strong>. Buy and read a good and most recent travel guide about the city or area you\'re traveling to.<br />\r\n3. <strong>Local Food, Restaurants and Bars</strong>. Get familiar with local food and ask local people which local restaurant they recommend and why. If you\'re vegetarian, find out if there is a vegetarian restaurant in an area. If any cuisine is fine with you, check which restaurants good but inexpensive food-  you may stay there a week or even more, so there is no point to overspend. Leave visits in expensive restaurants for evening escapades with the person you\'re visiting. <br />\r\n4. <strong>Local Transportation</strong>. Find out about local transportation. If you\'re taking a flight, make sure someone from the hotel will pick you up at the airport. If this isn\'t possible, find out if you can take a reliable taxi service from the airport. Never use a private taxi (so called gypsy taxi). Always use officially registered telephone ( tele ) taxi service. <br />\r\n5. <strong>Internet Access</strong>. Find out if your hotel room has high speed Internet access. If not, find a reliable Internet cafe close to your hotel. Ask hotel reception to confirm.<br />  \r\nFor more information on  hotels and accommodation, restaurants, travel, airplane tickets, car renting and other travel related services to and from %GEO_TREE_STRING%, please check <a href=\"http://www.TripAdvisor.com\">TripAdvisor.com</a> and  <a href=\"http://www.Travelocity.com\">Travelocity.com</a>.</p> ',NULL,'',1,0,NULL,0,'Map',''),
	(13416,2,'Area Info Headline','<p>\r\n<a href=\"javascript:window.history.go(-1)\">[ << Wróć do profilu ]</a>\r\n</p>\r\n<h3>Wybierasz się w podroż do: %GEO_TREE_STRING%?</h3>\r\n<p>Jeśli planujesz podroż do %GEO_TREE_STRING%, upewnij się, że twoja lista rzeczy do zrobienia zawiera następujące punkty:<br />\r\n1. <strong>Hotel, noclegi, akomodacja</strong>. Zarezerwuj sobie pokój w hotelu, schronisku lub wynajmij na krótko mieszkanie, np. w systemie vacation rentals.<br />\r\n2. <strong>Przewodnik turystyczny, informacja turystyczna</strong>. Kup przeczytaj i przeczytaj nowo wydany przewodnik turystyczny po miejscowości i okolicy do której się wybierasz.<br />\r\n3. <strong>Lokalne jedzenie, bary i restauracje</strong>. Zorientuj się czy będzie ci odpowiadać lokalne jedzenie. Jeśli jesteś wegetarianinem, upewnij się, że w %GEO_TREE_STRING% jest wegetariańska restauracja. Jeśli każda kuchnia ci odpowiada, zorientuj się, która restauracja jest dobra i niedroga-  pamiętaj, że będziesz tam nawet tydzień lub i dłużej, dlatego nie ma sensu wydawać fortuny na samo jedzenie. Drogie restauracje zostaw sobie na wieczorne wyjścia z osobą która jest powodem twojej wizyty.<br />\r\n4. <strong>Port Lotniczy</strong>. Jeśli będziesz leciał samolotem, upewnij się, ze ktoś odbierze cię z lotniska - np. kierowca hotelu w którym się zatrzymasz. Jeśli nikt w porcie lotniczym nie będzie na ciebie czekał, sprawdź czy możesz wziąć taksówkę z portu lotniczego taksówkę do twojego hotelu - taką, która cię nie oszuka. Na wszelki wypadek zawsze korzystaj z tele taksi. Nigdy nie korzystaj z prywatnych taksówek, tak zwanych gipsy taxi. Pamiętaj, nie każdy port lotniczy to Okęcie, Heathrow lub J.F. Kennedy.<br />\r\n5. <strong>Internet</strong>. Dowiedz się, czy w pokoju hotelowym będziesz miał dostęp do internetu. Jeśli nie, czy jest w pobliżu hotelu jakaś kawiarenka internetowa?<br />\r\nStrona ta zawiera użyteczne informacje dotyczące hoteli, restauracji, transportu, biletów lotniczych, kolejowych, rozkładów jazdy i innych informacjo dotyczących miejscowości: %GEO_TREE_STRING%.</p> ',NULL,'',1,0,NULL,0,'Map',''),
