	(13767,2,'Homepage introduction - right','<br />\r\n<br />\r\n<h2>Kim Jest Księżniczka?</h2>\r\n<p>Atrakcyjna i inteligentna, czujesz, że zasługujesz na więcej. Nie chcesz dłużej marnować swej szansy. Jak każda prawdziwa kobieta, szukasz mężczyzny zaradnego i opiekuńczego, który doceni twoją wyjątkowość. Mężczyzny, przy którym zapomnisz o troskach i kłopotach dnia codziennego. Szukasz swojego <a href=\"http://www.szukammilionera.com/search/public/filter/filter/filters%5Blooking_for%5D/F_M.html\">milionera</a>...</p>\r\n',NULL,'',0,1276612160,149,1267118280,NULL,NULL),
