	(13995,1,'Manage subscription - paypal','<span class=\"public_reg_notice\"><h1>Your Subscription & Auto Renewal Status</h1></span>\r\nAccount type: <span class=\"public_reg_notice\">Premium</span>. To see what features are available to you, <a href=\"/en/subscription.html\" class=\"sec_link\">click here</a>.<br />\r\nCurrent subscription term: <span class=\"public_reg_notice\"> {amount_1st_period} for {1st period}, then {amount for 2nd period} for {2nd period}, after that {amount after that} every {3rd and following period}</span>.<br />\r\nNext payment amount: <span class=\"public_reg_notice\">%NEXT_PAYMENT_AMOUNT%</span><br />\r\nNext payment date: <span class=\"public_reg_notice\">%NEXT_PAYMENT_DATE%</span><br />\r\nSubscription ends: <span class=\"public_reg_notice\">when you Unsubscribe*</span><br /><br />\r\nImportant Safety Note: If you paid with PayPal, please make sure that you address and credit card (or bank) information with PayPal is up-to-date. This way there will be no discontinuity in your payments and you will not lose any discount. Please remember however, that  PayPal never sends emails with request to update user details. Any email received from \"PayPal\" that asks for any of your information or its update, or simply asks you to log in by clicking on a link, is fraudulent ( so called phishing). Please report it to PayPal and delete. Then log in to PayPal (type \"PayPal.com\", don\'t use any link), and check your details, or communicate with PayPal\'s support. If your browser asks you \"Remember Password?\" click Never or No and after the session, clear browser\'s all private data and reset the browser.<br />\r\nNeither send any credit card, bank or other personal information to us. We do not need it and we never ask for it. If you think you received such request from us, it must be phishing/ fraudulent - do not respond, send it to us and then delete. <br />\r\nFinally, never send any money to other PolishDate member. Any money request on a dating site is always fraudulent. Report it to us and block the sender. <br />\r\n<br />\r\n*If you unsubscribe now, you will still use Premium account until the end of the current subscription period - that is until <span class=\"public_reg_notice\">%EOT_DATE%</span>. On that day the system will switch your account to Standard and Premium account features will not be available to you.<br />\r\nTo unsubscribe, click UNSUBSCRIBE button below.<br />If you changed your mind or want to unsubscribe later, you may go to <a href=\"%URL_FOR_DASHBOARD%\" class=\"sec_link_small\">your account</a>.\r\n<br /><br /><br />',NULL,'',0,0,NULL,0,'',''),
