	(14113,14,'Homepage introduction','<br />\r\n<br />\r\n<h2> Meet Polish Singles</h2>\r\n<p>PolishDate is a dating service for Polish singles and their admirers. Here you can meet, date and fall in love. Whether you are looking for a marriage, romance or just a date, with gorgeous Polish woman or a cute Polish guy, PolishDate.com is your No. 1 choice.  Start looking for <a href=\"/en/search/public/filter/filter/filters%5Blooking_for%5D/M_F.html\">Polish singles</a> now...</p>',NULL,'',0,1267603478,2,0,NULL,NULL),
