	(14117,14,'Congratulations, your registration is complete.','Congratulations, your registration is complete!<br />\r\nThis is how your matches see your profile - without this message, of course :)<br />\r\nIf you want your profile look even better, do this:<br />\r\n1. <a href=\"%URL_FOR_PHOTOS%\" class=\"actions\">Add the best photos</a> that you have. Ask a photographer friend for a favor or go to a professional - do not save on your photos! Add more photos as time goes by.<br />\r\n2. Regularly check your <a href=\"%URL_FOR_ESSAY%\" class=\"actions\">\"about me\"</a> post to make sure it sounds fresh and has no error.<br />\r\n3. Make sure your <a href=\"%URL_FOR_SELF_DESCRIPTION%\" class=\"actions\">self-description</a> is up to date.<br />\r\nIf you are happy with what you see, you may go back to <a href=\"%URL_FOR_DASHBOARD%\" class=\"actions\">your account</a> any time. [ref.301]',NULL,'',0,1274110848,8,0,NULL,NULL),
	(14118,14,'To edit your profile, go to self-description, posting/essay or photos on your dashboard.','This is how your matches see your profile - without this message, of course :)<br />\r\nIf you want your profile look even better, do this:<br />\r\n1. <a href=\"%URL_FOR_PHOTOS%\" class=\"actions\">Add the best photos</a> that you have. Ask a photographer friend for a favor or go to a professional - do not save on your photos! Add more photos as time goes by.<br />\r\n2. Regularly check your <a href=\"%URL_FOR_ESSAY%\" class=\"actions\">\"about me\"</a> post to make sure it sounds fresh and has no error.<br />\r\n3. Make sure your <a href=\"%URL_FOR_SELF_DESCRIPTION%\" class=\"actions\">self-description</a> is up to date.<br />\r\nIf you are happy with what you see, you may go back to <a href=\"%URL_FOR_DASHBOARD%\" class=\"actions\">your account</a> any time. [ref.302]',NULL,'',0,1274110848,9,0,NULL,NULL),
