	(14161,14,'Essay content','<strong>Writer\'s block? If so, write as if answering these questions:</strong><br /><br />\r\n<ul>\r\n<li>What are you doing with your life?</li><br />\r\n<li>What do you like doing when not working?</li><br />\r\n<li>Favorite book, movie, music or hobby?</li><br />\r\n<li>What are you really good at?</li><br />\r\n<li>Whom would you like to meet here? Contact me if...</li><br />\r\n<li>Be clear, concise, positive: don\'t mention bad experience, previous marriages or what you don\'t like in people (write what you like in people)... <a href=\"/en/page/writing_tips.html\" class=\"bread\">(more on writing a good profile)</a></li>\r\n</ul>',NULL,'',0,1268469641,47,0,NULL,NULL),
