	(14197,14,'Status canceled headline','Your account has been closed',NULL,'',0,1274708350,97,0,NULL,NULL),
	(14198,14,'Status canceled body','Your account has been closed by website administration due to the violation of our <a href=\"{USER_AGREEMENT_URL}\" class=\"sec_link\">Terms of Use</a>. Typical violations include spamming, scamming, suspicious activities, use of a stolen credit card, harassing other members, advertising other services, or due to other abuses.\r\n<p>If you were a paid member, you will not be charged again.</p> \r\n<p>If you believe your account was closed by mistake, you can <a href=\"{CONTACT_US_URL}\" class=\"sec_link\">contact us</a>. <span class=\"extra_info\">[SM606]</a></p>',NULL,'',0,1274708350,98,0,NULL,NULL),
	(14199,14,'Status denied headline','Registration denied',NULL,'',0,1274708350,99,0,NULL,NULL),
	(14200,14,'You registration has been denied.','You registration has been denied.<br /> According to our <a href=\"{USER_AGREEMENT_URL}\" class=\"sec_link\">Terms of Use</a>, we reserve the right to deny membership without further explanation.<br />\r\nThere are thousands of dating services on the Internet and we are certain you will find the one that will accommodate your needs. <span class=\"extra_info\">[SM607]</a>',NULL,'',0,1274708350,100,0,NULL,NULL),
	(14201,14,'Status flagged headline','Your account is suspended',NULL,'',0,1274708350,101,0,NULL,NULL),
