	(14205,14,'Status suspended headline','Account suspended by administrator!',NULL,'',0,1274708350,105,0,NULL,NULL),
	(14206,14,'Status suspended body','Your account has been suspended by website administration due to violation of our <a href=\"{USER_AGREEMENT_URL}\" class=\"sec_link\">terms of use</a>, like spamming, scamming, suspicious activities, use of a stolen credit card, harassing other members, advertising other services, or due to other abuses. Check in 1 or 2 days to see if you can still user our website. <span class=\"extra_info\">[SM610]</a>',NULL,'',0,1274708350,106,0,NULL,NULL),
