	(14208,14,'Tell a Friend body','Message sent. Thank you for recommending us to your friends. We appreciate that.\r\n<p>Now you may <a href=\"%URL_FOR_JOIN_NOW%\" class=\"sec_link\">join us</a>, if you haven\'t done so yet, or <a href=\"%URL_FOR_DASHBOARD%\" class=\"sec_link\">sign in</a>, if you are already a member.</p> <span class=\"extra_info\">[SM611]</a>',NULL,'',0,1274708350,108,0,NULL,NULL),
	(14209,14,'Email undo headline','Email changed successfully undone!',NULL,'',0,1274708350,109,0,NULL,NULL),
	(14210,14,'Your have undo your email change. Your email address is back to: %EMAIL%','Your have undone your last email change. Your email address is back to: %EMAIL%. Now please <a href=\"%URL_FOR_SIGNIN%\" class=\"sec_link\"> log in</a> and change you password.<br />\r\nPlease make sure to create a unique password that is a combination of CAPITAL and small letters, and digits. Do not use your name, birthday or email in your password. After you change your password, also change email address that you use with our account.<br />  \r\n<span class=\"extra_info\">[Message:612]</a>',NULL,'',0,1274708350,110,0,NULL,NULL),
	(14211,14,'Verify your email headline','Verify your email address!',NULL,'',0,1274708350,111,0,NULL,NULL),
	(14212,14,'For your own security, please go to your email box and verify your email by clicking on the link we have just sent you.','YOUR ACCOUNT IS NOT YET ACTIVE! \r\n<p>Please go to your email box, refresh the browser and read the email we have just sent you. If you don\'t find it in your Inbox, look into spam or junk folders and mark it as Not Spam.</p>\r\n<p>Email verification helps prevent unauthorized registration. <span class=\"extra_info\">[SM613]</a></p> \r\n\r\nEmail sent to: %EMAIL%',NULL,'',0,1274708350,112,0,NULL,NULL),
