	(14686,14,'Post your story confirmation body','Our team will review your story and hopefully it will be available online soon.<br />\r\nPlease note that according to our <a href=\"%URL_FOR_TERMS%\" class=\"sec_link\">Terms of Use</a> and <a href=\"%URL_FOR_PRIVACY_POLICY%\" class=\"sec_link\">Privacy Policy</a>, we reserve the right to cut, edit or otherwise change your story without any explanation. We may also take your story off our site at any time or not publish it at all. We also do not respond to any queries related to the stories, except for request to take the story off the site. In order to do so however, you must write to us from the same email address as you entered while submitting the story.',NULL,'',1,0,NULL,0,'PostYourStory','en/memberStories/postYourStory.html'),
