	(14701,14,'IMBRA note','<span>The application will not be \"signed\" in the sense of a traditional paper document. To verify the contents of the application, the signatory must enter any alpha/numeric character(s) or combination thereof of his or her choosing, preceded and followed by the forward slash (/) symbol. The PolishRomance does not determine or pre-approve what the entry should be, but simply presumes that this specific entry has been adopted to serve the function of the signature. Most signatories simply enter their names between the two forward slashes, although acceptable \"signatures\" could include /john doe/-  /jd/-  or /123-4567/. The application may still be validated to check for missing information or errors even if the signature and date signed fields are left blank.</span><br /><br /><br />',NULL,'',0,1251612542,69,0,'',''),
