	(14806,14,'Thank you for your payment and for using our services. We hope you will have a very enjoyable and unforgettable experience with PolishRomance.<br /><br /> You may now <a href=\"%URL_FOR_DASHBOARD%\" class=\"sec_link\">go to your dashboard</a> or <a href=\"%URL_FOR_MATCHES%\" class=\"sec_link\">see your matches</a> and start your search for Polish love.','Thank you for your payment. We hope you will find on PolishDate.com exactly what you are looking for.<br /><br /> You may now go to <a href=\"%URL_FOR_DASHBOARD%\" class=\"sec_link\">your account</a> or continue <a href=\"%URL_FOR_MATCHES%\" class=\"sec_link\">search for love</a>.',NULL,'',0,0,NULL,0,'Payment,Body','/en/subscription/thankyou.html'),
	(14807,14,'Here you can delete your account - you will lose your information and you won\'t be able to recover it. <br /><span>Deleting your account cannot be reversed. You will loose all your information, including profile, photos and messages.<br />Are you sure you want to delete?</span><br /><br /><a href=\"%URL_FOR_YES_DELETE%\" class=\"sec_link\">Yes, delete my account anyway</a><br /><br/><a href=\"%URL_FOR_NO_DELETE%\" class=\"sec_link\">No, don\'t delete my account</a>','<p>Closing account is permanent. You will loose all your information, including profile, photos and messages.</p>\r\n<h3>Are you sure you want to close your account?</h3>\r\n<p>\r\n<br />\r\n<a href=\"%URL_FOR_YES_DELETE%\" class=\"sec_link\">Yes, delete my account anyway</a>\r\n</p>\r\n<br />\r\n<p>\r\n<a href=\"%URL_FOR_NO_DELETE%\" class=\"sec_link\">No, don\'t delete my account</a>\r\n</p>\r\n<br />\r\n<p>\r\nIf you only want to deactivate your account without closing it, please <a href=\"%URL_FOR_DEACTIVATE_PROFILE%\" class=\"sec_link\"> click here</a>.\r\n</p>',NULL,'',0,0,NULL,0,'Delete Account','/en/dashboard/deleteYourAccount.html'),
