	(14876,14,'Standard: For the feature that you want to use - contact assistant - you have reached the daily limit up to which you can use it with your membership. In order to contact online assistant, please upgrade your membership.','You have reached the daily limit of messages that that you can send to assistant with your current account. To be able to contact our assistant again, please <a href=\"%URL_FOR_SUBSCRIPTION%\" class=\"sec_link\">upgrade to Premium Account</a> or wait till tomorrow. Daily limit helps preventing spam and other inappropriate activities on the Internet.<br />[ref.12071].',NULL,'',0,0,NULL,0,'ContactAssistant,dashboard,System Notification_Limit',NULL),
	(14877,14,'VIP: For the feature that you want to use - contact assistant - you have reached the daily limit up to which you can use it with your membership. In order to contact online assistant, please upgrade your membership.','You have reached the DAILY limit of messages that you can send to our assistant. Wait till tomorrow or <a href=\"/en/page/contact_us.html\">click here</a> to contact us in urgent matter. Daily limits are important tool in effective management of the website an in preventing temporary overloads. <br />[ref.12084].',NULL,'',0,0,NULL,0,'System Notification_Limit,ContactAssistant',NULL),
