	(14879,14,'VIP: For the feature that you want to use - read a message - you have reached the daily limit up to which you can use it with your membership. In order to read a message, please upgrade your membership.','You have reached the DAILY limit of new messages that you can read. When a new month of your subscription begins, you will be able to read new messages. Monthly limits are important tool in effective management of the website an in preventing temporary overloads. <br />[ref.12110].',NULL,'',0,0,NULL,0,'System Notification_Limit,Messages_Send/Reply',NULL),
	(14880,14,'Standard: For the feature that you want to use - reply to message - you have reached the daily limit up to which you can use it with your membership. In order to reply to message, please upgrade your membership.','You have reached the daily limit of new messages that you can reply to with your current account. To be able to reply to new messages again, please <a href=\"%URL_FOR_SUBSCRIPTION%\" class=\"sec_link\">upgrade to Premium Account</a> or wait till tomorrow. Daily limit helps preventing spam and other inappropriate activities on the Internet.<br />[ref.12123]',NULL,'',0,0,NULL,0,'Messages_Send/Reply,System Notification_Limit',NULL),
