	(14957,14,'Homepage footer articles','<center><h1>WHY POLISH DATING?</h1></center>\r\n<p>People sign up to Polish Date every day to meet Polish singles, flirt, date and fall in love. PolishDate.com is growing fast revolutionizing the <strong>Polish Internet Dating</strong>. Polish Date is on a mission to become the most ambitious Polish Dating service <strong>Polish singles</strong> not only in Poland, but also in USA, UK & Ireland, continental Europe, Russia, Brazil, Canada, Australia, New Zealand, South Africa, and many other countries where Polish Singles - men and women - happen to live. Singles on PolishDate are usually serious about finding love and they look for lasting, long-term relationship (LTR). Thanks to PolishDate.com, you can be in control of your love life.</p> \r\n<center><h1>FIND POLISH GIRLS</h1></center>\r\n<p>With Polish Date meeting that someone special, a hot polish women or a cute Polish girl, or forming a lasting relationship with Polish gay man, is fun and easy-  all you need is clicking on any one of the thousands of photos and videos available online on PolishDate.com. And whatever your preference is, you can find it here. Whether you\'re interested in cute <strong>Polish Men</strong>, hot <strong>Polish Girl</strong>, hot <strong>Polish Women</strong> or <strong>Polish Gay Men</strong>, this Polish Dating site can help you find the kind of relationship that fits you best. Search through Polish online personals and look through hundreds of Polish online personal ads right in your area.</p>\r\n<center><h1>YOUR POLISH ONLINE COMMUNITY</h1></center>\r\n<p>So who\'s on PolishDate.com? Our members are common and non-common Polish men and Polish women, and your colleagues, friends, neighbors, and coworkers. The Polish beautiful girl from your neighborhood you haven’t had a chance to talk to yet. This handsome cute Polish guy from the corner shop you always wanted to meet but were not brave enough to start a conversation with. Now you can find them in the comfort of your room, read their profiles and contact them easily online without a fear of real life rejection.\r\nEvery day, new singles join our growing Polish Dating community creating a diverse, global community of Polish and non-Polish singles with common goals – to meet other singles, find dates, establish romantic and lasting relationships, and, of course, to find the love of their life and meet life partners. Straight and gay, young and old, Polish and foreign, singles from around around the world, come to PolishDate.com to get Polish Date, flirt, meet, date, have fun, fall in love, and to form meaningful, loving relationships. At some stage, our community will be divided into location based sub-communities, such as PolishDating US, PolishDating UK, PolishDating Italy, PolishDating Germany (Deutschland), PolishDating Ireland and PolishDating Poland. Currently the website has English and Polish, but we are working hard to add more languges.</p>\r\n<center><h1>FREE DATING SERVICE</h1></center>\r\n<p>Polish Date is a free Polish Internet dating service with extra privacy and video chat available only with paid Premium Membership. At PolishDate.com – professional and sophisticated Polish Online Dating Internet Service - new members always register for free and upgrade only if they wish so. Depending on how you use the website and how often and by whom you’re contacted, you may never need to upgrade to Premium Member, which comes at a low monthly rate – an equivalent of the cost of fish and cheaps perhaps or salmon sandwich. You may say – well, food is a necessity-  I can’t really live without it … \r\nBut so is love. You can’t really live without it either, can you?  And if so, why not choose the most effective and money saving Polish Dating service available – PolishDate.com. Life is short, so don’t waste your time any longer - fall in love. After all - you live to love, don’t you?</p>',NULL,'',0,1267603478,148,0,NULL,NULL),
